var $ = require('jquery');
var Backbone = require('backbone');
var _ = require('underscore');

Backbone.$ = $;

var PaginationTpl = require('tpl/PaginationTpl.hbs');


module.exports = Backbone.View.extend({

  events: {
    "click li" : "selectProject"
  },

  initialize: function () {
    var _this = this;
    this.render();
  },

  render: function () {
    var _this = this;
    _this.$el.append(PaginationTpl());
  }
});